import React from "react";

const Sticky = ({colour, angle, title, text}) =>{
    return (
        <div className="pt-5 p-5 w " style={{backgroundColor: colour,  rotate: angle}}>
            {title === 'NULL' ? (
                <>
                    <p>{text}</p>
                </>
            ) : (
                <>
                    <h1>{title}</h1>
                    <p>{text}</p>
                </>
            )}

        </div>
    );
};

export default Sticky;
